import CoinStore from "./coins";
class Store {
    btc=new CoinStore("XBTUSDT")
    eth=new CoinStore("ETHUSDT")
    tt=new CoinStore("ADAUSDT")
    constructor() {
      console.log(this.btc.price)
      makeAutoObservable(this)
    }
    
    
}
export default new Store;
